  if (favSeries === "netflix") {
    return <Netflix />;
  } else {
    return <Amazon />;
  }
};

const App = () => (
  <>
    <h1 className="heading_style">List of top 5 Netflix Series 2020</h1>
    <FavS />
  </>
);

export default App;
